import React from 'react';
import ProductList from "../ProductList";
import data from '../data/data.json'

export default class ProductPage extends React.Component{
    state={
    products: data
    }
    render() {
        const {products} = this.state
        

        return(
            <div>
                <ProductList products={products}/>
            </div>
        )
    }
}
